import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Header from "./component/header";
import Footer from "./component/footer";

import Slider from "./pages/slider";
import Trading from "./pages/trading";
import Whyxpo from "./pages/whyxpo";
import About from "./pages/about";
import Fromindex from "./pages/fromindex";
import Blog from "./pages/blog";
import Team from "./pages/team";
import Contact from "./pages/contact";
import Searchpopup from "./pages/searchpopup";
import Sidebarinfo from "./pages/sidebarinfo";
import Modal from "./pages/modal";
import Awards from "./pages/awards";
import Login from "./pages/login";
import Signup from "./pages/signup";

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Slider />} />
        <Route path="/trading" element={<Trading />} />
        <Route path="/awards" element={<Awards />} />
        <Route path="/about" element={<About />} />
        <Route path="/whyxpo" element={<Whyxpo />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/fromindex" element={<Fromindex />} />
        <Route path="/team" element={<Team />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/search" element={<Searchpopup />} />
        <Route path="/sidebar" element={<Sidebarinfo />} />
        <Route path="/modal" element={<Modal />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
